$(function(){
  $.each(mx_estados_municipios.listado, function (index, value) {
    //$("#country").find("option:gt(0)").remove();
    $("#salon_estado").append('<option value="'+value.id+'">'+value.estado+'</option>');
  });

    $('#salon_estado').on('change', function(){
      //console.log($(this).val());
      for(var i = 0; i < mx_estados_municipios.listado.length; i++)
      {
        if(mx_estados_municipios.listado[i].id == $(this).val())
        {
           $('#salon_municipio').html('<option value="000">Seleccionar</option>');
           $.each(mx_estados_municipios.listado[i].municipios, function (index, value) {
              $("#salon_municipio").append('<option value="'+value.id+'">'+value.name+'</option>');
          });
        }
      }
  });
});


